window.bookSummaryJSON = "<p><b>Venturing into the unknown means pushing the limits of everything thought possible.</b></p> <p>Ten years ago, the <i>Ark II</i> departed on a long journey through interstellar space, but shortly after they reached their destination, all communications ceased. All attempts to re-establish contact have failed.</p> <p>Utilizing prototypical FTL technology that he invented, one brave man will lead a small expedition into the unknown to discover the colonyâ€™s fate.</p> <p>The challenges of establishing the first interstellar colony nearly destroyed humanity. What new challenges will the second colony bring?</p> <p><i>Science Fiction for those who long to explore!</i></p> <p><b><i>Infinity</i></b><b> is the 13th book in the bestselling military science fiction series, First Colony. Listen to the thirteenth book in this sprawling space opera today!</b></p>"; 
